CREATE OR REPLACE PROCEDURE REGISZTRAL(V_NEV IN STRING,V_JELSZO IN STRING,V_EMAIL IN STRING,V_DOB IN DATE,
V_NEM IN INT, V_MEGHIVO IN INT,V_PROFILKEP IN STRING) IS
 PRAGMA AUTONOMOUS_TRANSACTION;
 V_ID NUMBER;
BEGIN 
